(* marque des antécédents AUB AiB B: 4 -2 et 4*)
assert(Hp1p2m2 : rk(p1 :: p2 :: nil) >= 2).
{
	assert(HAp1p3eq : rk(A :: p1 :: p3 :: nil) = 1) by (apply LAp1p3 with (A := A) (B := B) (C := C) (D := D) (E := E) (Ap := Ap) (Bp := Bp) (Cp := Cp) (Dp := Dp) (Ep := Ep) (p1 := p1) (p2 := p2) (p3 := p3) (p4 := p4) (p5 := p5) ; assumption).
	assert(HAp1p3Mtmp : rk(A :: p1 :: p3 :: nil) <= 1) by (solve_hyps_max HAp1p3eq HAp1p3M1).
	assert(HAp1p2p3eq : rk(A :: p1 :: p2 :: p3 :: nil) = 2) by (apply LAp1p2p3 with (A := A) (B := B) (C := C) (D := D) (E := E) (Ap := Ap) (Bp := Bp) (Cp := Cp) (Dp := Dp) (Ep := Ep) (p1 := p1) (p2 := p2) (p3 := p3) (p4 := p4) (p5 := p5) ; assumption).
	assert(HAp1p2p3mtmp : rk(A :: p1 :: p2 :: p3 :: nil) >= 2) by (solve_hyps_min HAp1p2p3eq HAp1p2p3m2).
	assert(Hp1mtmp : rk(p1 :: nil) >= 1) by (solve_hyps_min Hp1eq Hp1m1).
	assert(Hincl : incl (p1 :: nil) (list_inter (p1 :: p2 :: nil) (A :: p1 :: p3 :: nil))) by (repeat clear_all_rk;my_inO).
	assert(HT1 : equivlist (A :: p1 :: p2 :: p3 :: nil) (p1 :: p2 :: A :: p1 :: p3 :: nil)) by (clear_all_rk;my_inO).
	assert(HT2 : equivlist (p1 :: p2 :: A :: p1 :: p3 :: nil) ((p1 :: p2 :: nil) ++ (A :: p1 :: p3 :: nil))) by (clear_all_rk;my_inO).
	try rewrite HT1 in HAp1p2p3mtmp;try rewrite HT2 in HAp1p2p3mtmp.
	assert(HT := rule_2 (p1 :: p2 :: nil) (A :: p1 :: p3 :: nil) (p1 :: nil) 2 1 1 HAp1p2p3mtmp Hp1mtmp HAp1p3Mtmp Hincl);apply HT.
}

assert(Hp1p2M : rk(p1 :: p2 ::  nil) <= 2) (* dim : 5 *) by (solve_hyps_max Hp1p2eq Hp1p2M2).
assert(Hp1p2m : rk(p1 :: p2 ::  nil) >= 1) by (solve_hyps_min Hp1p2eq Hp1p2m1).
